import { Rate } from "antd";
import React from "react";

const Score = ({comments}) => {

    console.log("개별댓글 점수", comments[0].rate)

    return(
        <>
        {comments.map(comment => (
            <li key={comment.id}>
                <Rate style={{fontSize: 50}} defaultValue={comment.rate} />
            </li>
        ))}
        </>
    );
}


export default Score;
